SUPER, – в ответе качественно раскрыто содержание темы;
– прекрасно освоен понятийный аппарат;
– продемонстрирован высокий уровень понимания материала при решении практических
задач.

GOOD – основные вопросы темы раскрыты;
– хорошо освоен понятийный аппарат;
– продемонстрирован хороший уровень понимания материала при решении практических
задач.

BAD– тема раскрыта частично;
– понятийный аппарат освоен частично;
– понимание отдельных положений из материала по теме при решении практических задач.

MEDIUM – тема раскрыта частично;
– понятийный аппарат освоен частично;
– понимание отдельных положений из материала по теме при решении практических задач.
